import "./Ticket.css";
import TicketBg from "../../../assets/ticket-background.svg";

function Ticket(props) {
    return (
        <div className="book-page-container ticket-page">

            <div className="ticket-anim-container">anim</div>



            <div className="ticket-container">
                {/*<img src={TicketBg}/>*/}
                <div className="ticket-text">
                    <h3>You're all done!</h3>
                    <div>You just booked 3 tickets for The Salingers Year (2023 )202320232023!  </div>
                    <div className="ticket-data">
                        <p>Ticket no.: 32132121</p>
                        <p>Price: 13.4€</p>
                        <p>Date and time: 2 June 2023, 13:14</p>
                    </div>
                </div>

            </div>
            <div className="outside-ticket-data">
                <h2>Summary</h2>
                <p>Movie title: You just booked 3 tickets for The Salingers Year (2023 )202320232023</p>
                <p>Ticket no.: 32132121</p>
                <p>Price: 13.4€</p>
                <p>Date and time: 2 June 2023, 13:14</p>
            </div>
        </div>
    );
}

export default Ticket;
